import React, { useState } from "react"

const Demo = () => {
    const intialState = { id: "", link: "" }
    const [getLink, setLink] = useState(intialState)
    const [getItemList, setItemList] = useState([])
    return (
        <div>
            <div style={{ marginTop: "10px" }}>
                <input type="text"
                    onChange={(event) => { setLink({ ...getLink, id: event.target.value }) }}
                />
            </div>
            <div style={{ marginTop: "10px" }}>
                <input type="text"
                    onChange={(event) => { setLink({ ...getLink, link: event.target.value }) }}
                />
            </div>
            <div style={{
                width: "100%",
                marginTop: "10px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center"
            }}>
                <button
                    onClick={() => { setItemList(getLink) }}
                >Add</button>
            </div>
            <div style={{
                width: "100%",
                marginTop: "10px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center"
            }}>
                <ui>
                    {getItemList.map(item => <li>ID:{item.id}</li>,<li>Link:{item.link}</li>)}
                    <li>xxxx</li>
                </ui>
            </div>
        </div >
    )
}

export default Demo
